def palgen10(l): # generator of palindromes of length <= 2*l
    if l > 0:
        yield 0
        for x in range(1,l+1):
            n = 10**(x-1)
            n2 = n*10
            for y in range(n,n2):
                s = str(y)
                yield int(s+s[-2::-1])
            for y in range(n,n2):
                s = str(y)
                yield int(s+s[::-1])
def palcheck(n, b): # check if n is a palindrome in base b
    s = digits(n, b)
    return s == s[::-1]
A248889_list = [n for n in palgen10(9) if palcheck(n, 18)]
